GameProtocolCommonParser.FindElementPositionsIgnoreSign = function(element, theList) {
    var rv = [];
    for (var i = 0; i < theList.length; ++i)
        if (Math.abs(theList[i]) == element)
            rv.push(i);
    return rv
}
