VideoSlotsConnection.prototype.IsFreeSpinWin = function() {
    if (this.IsFreeSpin())
        if (this.FreeSpinMaxNumber() > 0 && this.storedMaxFS < this.FreeSpinMaxNumber()) {
            this.storedMaxFS = this.FreeSpinMaxNumber();
            return true
        } else
            return false;
    this.storedMaxFS = -1;
    return false
}
