function StageSpin() {
    UHTStage.call(this);
    this.cat = null;
    this.startEvent = null;
    this.spinEnded = false;
    this.isBonusRounds = false;
    this.rq = null;
    this.isRQEnded = false;
    this.shouldResetSpinCycleWinDisplayed = false
}
StageSpin.prototype.GetStageName = function() {
    return UHTStageName.Spin
}
;
