VS_ReelSymbolHolder.prototype.DiscardSymbol = function() {
    if (this.currentSymbol != null)
        this.parentReel.reelsManager.symbolsManager.RecycleSymbol(this.currentSymbol, this.symbolIsLooper);
    this.currentSymbol = null
}
