VS_ReelsManager.prototype.ShouldSpinReel = function() {
    if (XT.GetInt(Vars.ReelToBeSpun) != -1)
        if (this.reelToStart == XT.GetInt(Vars.ReelToBeSpun))
            return true;
        else
            return false;
    return true
}
