        if (this.useButtonsGroups && btnsCount > 0)
            this.buttonsGroups[btnsCount - 1].UpdateButtons(this.notification.buttons);
        else
            for (var i = 0; i < btnsCount; ++i)
                this.buttons[i].UpdateButton(this.notification.buttons[i]);
